/**
 * Only Java project have multiple modules
 *
 * @IndexedDB
 */
class GHCModule {
    constructor() {
        /**
         * RabiVersion id
         *
         * @type {number}
         */
        this.versionId = -1

        this.lastSelectedGroupId = -1

        /**
         * Module name
         *
         * @type {string}
         */
        this.name = ""

        /**
         * Java RPC Services, generated by Java project
         *
         * @type {JsonService[]}
         */
        this.javaServices = []

        /**
         * Java RPC Models, generated by Java project
         *
         * @type {JsonStruct[]}
         */
        this.javaModels = []

        /**
         * Generated by Java project or API description file
         * @type {JsonService[]}
         */
        this.restfulApis = []

        /**
         * @type {JsonStruct[]}
         */
        this.restfulModels = []

        /**
         *
         * @type {*[]}
         */
        this.apis = []

        /**
         * @type {*[]}
         */
        this.models = []

        /**
         * Cache opened tabs in each group, groupId -> [] ids
         * @since 1.5.0
         * @type {{}}
         */
        this.contentTabCache = {}
    }
}

export default GHCModule